                c += 'W'
            else:
                c += 'S'
    res = ''
    for i in range(len(c)):
        if c[i-1] == c[(i+1)-len(c)]:
            if c[i] == 'S':
                res += 'o'
            else:
                res += 'x'
        else:
            if c[i] == 'S':
                res += 'x'
            else:
                res += 'o'
    if res == s:
        print(c)
        exit()
